const NotAlive = ({ name, species, image, handleName }) => {
  return (
    <div
      style={{
        color: "red",
        backgroundColor: "pink",
        height: "450px",
        margin: "10px",
      }}
    >
      <p>{handleName(name)}</p>
      <p> Specie: {species}</p>
      <img className="picture" alt={name} src={image}></img>
    </div>
  );
};

export default NotAlive;
